#include <generate/base_time_mask.frag>
// Shader downloaded and adapted from glslsandbox.com
// URL: http://glslsandbox.com/e#49147.0

#ifdef GL_ES
precision mediump float;
#endif

//#extension GL_OES_standard_derivatives : disable


uniform vec2 mouse;
;


// Ziad 12 / 09 / 2018
// Leon 05 / 07 / 2017
// using lines of code of IQ, Mercury, LJ, Koltes, Duke

#define PI 3.14159
#define TAU PI*2.

#define DITHER
#define STEPS 16.
#define BIAS 0.00001
#define DIST_MIN 0.01

mat2 rot (float a) { float c=cos(a),s=sin(a);return mat2(c,-s,s,c); }
float sphere (vec3 p, float r) { return length(p)-r; }
float cyl (vec2 p, float r) { return length(p)-r; }
float torus( vec3 p, vec2 s ) {
  vec2 q = vec2(length(p.xz)-s.x,p.y);
  return length(q)-s.y;
}
float smin (float a, float b, float r) {
    float h = clamp(.5+.5*(b-a)/r,0.,1.);
    return mix(b,a,h)-r*h*(1.-h);
}
float rand(vec2 co) { return fract(sin(dot(co*0.123,vec2(12.9898,78.233))) * 43758.5453); }
vec3 camera (vec3 p) {
    p.yz *= rot((PI*(mouse.y/pyvisualResolution.y-.5)*step(0.5,mouse.x)));
    p.xz *= rot((PI*(mouse.x/pyvisualResolution.x-.5)*step(0.5,mouse.x)));
    p.yz *= rot(-PI*.5);
    return p;
}

float opDisplace( vec3 p )
{
    float d1 = torus(p,vec2(.4,.3));
    float d2 = cos(2.*p.x)*sin(2.*p.y)*sin(2.*p.z);
    return d1+d2;
}

float opTwist( vec3 p )
{
    float c = cos(0.0*p.y);
    float s = sin(1.0*p.y);
    mat2  m = mat2(c,-s,s,c);
    vec3  q = vec3(m*p.xz,p.y);
    return opDisplace(p);
}

float map (vec3 p) {
    vec3 p1 = p;
    float geo = 1.;
    float cy = 0.4;
    const float repeat = 2.;
    p1.xy *= rot(length(p)*.5);


    float t = pyvisualTime*0.3;

    for (float i = 0.; i < repeat; ++i) {
        p1.yz *= rot(0.3+t*0.5);
        p1.xy *= rot(0.2+t);
        p1.xz *= rot(.15+t*2.);

       	p1.xy *= rot(p.x*.5+t);

        // gyroscope
      //  geo = smin(geo, (torus(p1,vec2(1.+i*.2,.12))), .3);


        // tentacles cylinders
        geo = smin(geo, (opTwist(p1)), .6);

        // torus along the cylinders
        vec3 p2 = p1;
        p2.y = mod(p2.y,cy)-cy/2.;
        geo = smin(geo, (opTwist(p2)), .1);
    }
    return geo;
}





void generateFrag() {





	vec2 uv = ((vec2(pyvisualUV.x, 1.0 - pyvisualUV.y) * pyvisualResolution).xy-.5*pyvisualResolution.xy)/pyvisualResolution.y;
    vec3 eye = camera(vec3(uv,-2));
    vec3 ray = camera(normalize(vec3(uv,.75)));
    vec3 pos = eye;
    float shade = 0.;
    #ifdef DITHER
	vec2 dpos = ( (vec2(pyvisualUV.x, 1.0 - pyvisualUV.y) * pyvisualResolution).xy / pyvisualResolution.xy );
	vec2 seed = dpos + fract(pyvisualTime);
	#endif 
    for (float i = 0.; i < STEPS; ++i) {
		float dist = map(pos);
        if (dist < BIAS) {
            shade += 0.9;
        }
        #ifdef DITHER
        dist=abs(dist)*(0.1+0.2*rand(seed*vec2(i)));
        #endif 
        dist = max(DIST_MIN,dist);
        pos += ray*dist;
    }
	pyvisualOutColor =vec4(1.);
	pyvisualOutColor.rgb = vec3(shade/(STEPS-1.),shade*0.9/(STEPS-1.),shade*0.9/(STEPS-1.));

}
